import React from "react";
import Navbar from "./components/Navbar";
import { Container } from "react-bootstrap";

const App = () => {
  return (
    <>
      <Navbar />
      <main className="py-3">
        <Container>
          <h1>Welcome to Pro Shop</h1>
        </Container>
      </main>
      <Footer />
    </>
  );
};

export default App;
